import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import './App.css';
import UserDashboard from './UserDashboard';
import TransferList from './TransferList';

function App() {
  const user = {
    name: "山田太郎",
    accountNumber: "普通 1234567",
    balance: 3000000,
    iconUrl: "https://example.com/user-icon.jpg"
  };

  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={
            <>
              <UserDashboard user={user} />
              <Link to="/transfer" className="transfer-link">送金先一覧</Link>
            </>
          } />
          <Route path="/transfer" element={<TransferList />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
